import React from 'react';
import {Link} from "react-router-dom";
import {Helmet, HelmetProvider } from "react-helmet-async";

const EditorApp = () => {
    return (
        <div id= 'editor'>

            <Helmet>
                <script type="text/javascript" src="./externalApp/editor.js"/>
            </Helmet>
        </div>
    );
}

export default EditorApp;
